import * as React from 'react';
import {NavigationContainer} from '@react-navigation/native';
import Tabs from './navigation/TabBar';


const App = () => {
  return(
    <NavigationContainer>
      <Tabs />
    </NavigationContainer>
  );
}

export default App;
